@Injectable({
  providedIn: 'root'
})
export class ComunicatorComponetsService {
  state=true;
  constructor() { }
  public setshowHideNavBar(state:boolean){
    this.state=state;
  }
  public getShowHideNavBar():boolean{
    return this.state;
  }
}
